"use strict";(self.webpackChunkseongkyu_lim=self.webpackChunkseongkyu_lim||[]).push([[8733],{6796:function(n){n.exports=JSON.parse('{"blogPosts":[{"id":"knowledge4","metadata":{"permalink":"/Blog/blog/knowledge4","editUrl":"https://github.com/facebook/docusaurus/edit/main/website/blog/blog/2022-03-05-knowledge4.mdx","source":"@site/blog/2022-03-05-knowledge4.mdx","title":"3\uc6d4 05\uc77c\uc758 \uae68\ub2ec\uc74c","description":"\ud504\ub85c\uc81d\ud2b8\uc758 \uc694\uad6c\uc0ac\ud56d\uc911\uc5d0 \u2018\ub9e4\uc7a5 \uc2dd\uc0ac \uc778\uc6d0\uc740 \ucd5c\uc18c 0\uba85\uc774\uc0c1\uc774\uc5b4\uc57c\ud55c\ub2e4.\u2019\uc640 \uac19\uc740 \uc870\uac74\uc774 \uc788\ub2e4. \ud2b9\uc815 \ubcc0\uc218\uc758 \uac12\uc744 \uac80\uc0ac\ud558\ub294 \ubc29\ubc95\uc740 \ubb34\uc5c7\uc778\uac00 ?","date":"2022-03-05T00:00:00.000Z","formattedDate":"March 5, 2022","tags":[{"label":"knowledge","permalink":"/Blog/blog/tags/knowledge"}],"readingTime":3.165,"truncated":false,"authors":[{"name":"Lim SeongKyu","title":"BE","url":"https://github.com/seongkyu-lim","imageURL":"https://github.com/seongkyu-lim.png","key":"seongkyu"}],"nextItem":{"title":"2\uc6d4 27\uc77c\uc758 \uae68\ub2ec\uc74c","permalink":"/Blog/blog/knowledge3"}},"content":"## \ud504\ub85c\uc81d\ud2b8\uc758 \uc694\uad6c\uc0ac\ud56d\uc911\uc5d0 \u2018\ub9e4\uc7a5 \uc2dd\uc0ac \uc778\uc6d0\uc740 \ucd5c\uc18c 0\uba85\uc774\uc0c1\uc774\uc5b4\uc57c\ud55c\ub2e4.\u2019\uc640 \uac19\uc740 \uc870\uac74\uc774 \uc788\ub2e4. \ud2b9\uc815 \ubcc0\uc218\uc758 \uac12\uc744 \uac80\uc0ac\ud558\ub294 \ubc29\ubc95\uc740 \ubb34\uc5c7\uc778\uac00 ?\\n\\n\uc544\ubb34\ub7f0 \ubd80\uac00\uc801\uc778 \uae30\ub2a5\ub4e4\uc744 \uc54c\uc544\ubcf4\uc9c0\uc54a\uace0 \uc21c\uc218 \uc5b8\uc5b4\ub2e8\uc704\uc5d0\uc11c\ub9cc \uc0dd\uac01\ud574\ubcf4\uba74, \ub2e8\uc21c\ud558\uac8c \ubc1b\uc544\uc628 \ub370\uc774\ud130 \uac12(numOfGuests)\ub97c \uc870\uac74\ubb38\uc73c\ub85c \uac12\uc774 0\uc774\uc0c1\uc778\uc9c0 \uccb4\ud06c\ud558\uc5ec \ucc98\ub9ac\ub97c \ub2e4\ub974\uac8c \ud560 \uc218 \uc788\uaca0\ub2e4..\\n\\n\ud558\uc9c0\ub9cc \uc2a4\ud504\ub9c1\uc5d0\uc11c\ub294 \uc62c\ubc14\ub974\uc9c0\uc54a\uc740 \ub370\uc774\ud130\ub97c \uac78\ub7ec\ub0b4\uace0 \ubcf4\uc548\uc744 \uc720\uc9c0\ud558\uae30\uc704\ud574 Spring Validation \ub77c\uc774\ube0c\ub7ec\ub9ac\ub97c \uc9c0\uc6d0\ud558\uba70, \uc774\ub97c \ud1b5\ud574 \ub370\uc774\ud130\uc758 <span style={{color: \'#ff7f00\'}}>\uc720\ud6a8\uc131</span>\uc744 \uac80\uc0ac\ud560 \uc218 \uc788\ub2e4.\\n\\n\uc544\ub798 \ucf54\ub4dc\ub294 \ub9e4\uc7a5 \uc2dd\uc0ac \uc8fc\ubb38\uc758 \uacbd\uc6b0, \ud574\ub2f9 \ud14c\uc774\ube14\uc758 \uc778\uc6d0\uc774 \ubcc0\uacbd\ub418\uc5c8\uc744 \ub54c \ubcc0\uacbd\ub41c \uc778\uc6d0\uc744 \uc5c5\ub370\uc774\ud2b8 \ud558\ub294 \ub85c\uc9c1\uc758 controller\ub2e8\uc774\ub2e4.\\n\\n![03-05-1.png](image/03-05-1.png)\\n\\n\uc774 \ub54c, @PathVariable\ub85c \ubc1b\uc544\uc624\ub294 numberOfGuests \ubcc0\uc218\uc758 \uc720\ud6a8\uc131\uc744 \uac80\uc0ac\ud558\uae30 \uc704\ud574\uc11c, validation \uc5b4\ub178\ud14c\uc774\uc158\uc744 \ubc14\ub85c \ud574\ub2f9 \ubcc0\uc218\uc5d0 \uc801\uc6a9\uc744 \ud560 \uc218 \uc788\ub2e4.\\n\\n@Min\uc5b4\ub178\ud14c\uc774\uc158\uc744 \ud1b5\ud574 \ud2b9\uc815 \uac12 \uc774\uc0c1\uc778\uc9c0 \uc5ec\ubd80\ub97c \uac80\uc0ac\ud560 \uc218 \uc788\ub2e4.\\n\\n<\ud574\ub2f9 \uc5b4\ub178\ud14c\uc774\uc158\uc758 \uc778\ud130\ud398\uc774\uc2a4\uc758 \uc124\uba85 \ub0b4\uc6a9.>\\n\\n![03-05-2.png](image/03-05-2.png)\\n\\n\uadf8 \uc774\uc720\ub85c\ub294, \uc544\ub798\ub294 \ud574\ub2f9 \ucee8\ud2b8\ub864\ub7ec\uc758 \uc5b4\ub178\ud14c\uc774\uc158\ub4e4\uc778\ub370, @Validated \uc5b4\ub178\ud14c\uc774\uc158\uc774 \uc801\uc6a9\ub418\uc5b4\uc788\ub294 \uac83\uc744 \ud655\uc778\ud560 \uc218 \uc788\ub2e4. \ud574\ub2f9 \uc5b4\ub178\ud14c\uc774\uc158\uc744 \ud074\ub798\uc2a4\uc5d0 \uc801\uc6a9\ud558\uba74, MethodValidationPostProcessor\uc5d0 \uc758\ud574\uc11c Validation\uc774 \uac00\ub2a5\ud558\ub3c4\ub85d \ud504\ub85d\uc2dc \uac1d\uccb4\uac00 \uc0dd\uc131\ub418\uace0 \uc0dd\uc131\ub41c \ud504\ub85d\uc2dc \uac1d\uccb4\ub97c \ud1b5\ud574\uc11c \ubc14\ub85c \uc801\uc6a9\ud558\uace0 \uac80\uc0ac\ud560 \uc218 \uc788\uac8c \ub418\ub294 \uac83\uc774\ub2e4.\\n\\n![03-05-3.png](image/03-05-3.png)\\n\\n\uadf8\ub807\ub2e4\uba74 controller\ub2e8\uc5d0\uc11c\uc758 \ub370\uc774\ud130\uac00 \uc544\ub2cc, requestBody\ub85c \ubc1b\uc740 dto\uc548\uc758 \ud2b9\uc815 \uba64\ubc84, \ub610\ub294 requestBody\ub85c \ubc1b\uc740 dto\uc548\uc758 \ub610\ub2e4\ub978 dto\uc548\uc758 \uac12\uc778 \uacbd\uc6b0, \uc989 \uac80\uc0ac \uc694\uc18c\uac00 \uc11c\ube0c\ud074\ub798\uc2a4\uc758 \uba64\ubc84\ub77c\uba74 \uc5b4\ub5bb\uac8c \uc720\ud6a8\uc131\uc744 \uac80\uc0ac\ud574\uc57c\ud560\uae4c ?\\n\\n\uc774 \ub54c\ub294 @Valid \uc5b4\ub178\ud14c\uc774\uc158\uc744 \uc0ac\uc6a9\ud574 \uac80\uc0ac\uac00 \uac00\ub2a5\ud558\ub2e4.\\n\\n\uc544\ub798\uc758 \ucf54\ub4dc\uc640 \uac19\uc774, @RequestBody\ub85c \ubc1b\uc740 dto\uc5d0 @Valid \uc5b4\ub178\ud14c\uc774\uc158\uc744 \ubd99\uc5ec\uc8fc\uace0, \ud574\ub2f9 dto\uc5d0\uc11c \uac00\uc9c0\ub294 \ub610\ub2e4\ub978 dto\uc5d0\ub3c4 @Valid\ub97c \ubd99\uc5ec\uc8fc\uace0 \uac80\uc0ac\ub97c \ud558\ub824\ub294 \ud074\ub798\uc2a4\uc5d0 \uc811\uadfc\ud558\uc600\uc744 \ub54c, \ud574\ub2f9 \ud074\ub798\uc2a4\uc758 \uac80\uc0ac\ud558\ub824\ub294 \uba64\ubc84\uc5d0\uac8c \uac80\uc0ac\ub97c \uc704\ud55c \uc5b4\ub178\ud14c\uc774\uc158\uc744 \ubd99\uc5ec\uc900\ub2e4.\\n\\n![03-05-4.png](image/03-05-4.png)\\n\\n![03-05-5.png](image/03-05-5.png)\\n\\n![03-05-6.png](image/03-05-6.png)\\n\\n![03-05-7.png](image/03-05-7.png)"},{"id":"knowledge3","metadata":{"permalink":"/Blog/blog/knowledge3","editUrl":"https://github.com/facebook/docusaurus/edit/main/website/blog/blog/2022-02-27-knowledge3.mdx","source":"@site/blog/2022-02-27-knowledge3.mdx","title":"2\uc6d4 27\uc77c\uc758 \uae68\ub2ec\uc74c","description":"kotlin collection \uad00\ub828 \ud568\uc218\ub4e4\uc744 \ud65c\uc6a9\ud558\uc5ec \ucf54\ub4dc\ub97c \ub354 \uae54\ub054\ud558\uac8c \ub9ac\ud329\ud1a0\ub9c1 \ud574\ubcf4\uc790!","date":"2022-02-27T00:00:00.000Z","formattedDate":"February 27, 2022","tags":[{"label":"knowledge","permalink":"/Blog/blog/tags/knowledge"}],"readingTime":2.62,"truncated":false,"authors":[{"name":"Lim SeongKyu","title":"BE","url":"https://github.com/seongkyu-lim","imageURL":"https://github.com/seongkyu-lim.png","key":"seongkyu"}],"prevItem":{"title":"3\uc6d4 05\uc77c\uc758 \uae68\ub2ec\uc74c","permalink":"/Blog/blog/knowledge4"},"nextItem":{"title":"1\uc6d4 21\uc77c\uc758 \uae68\ub2ec\uc74c","permalink":"/Blog/blog/knowledge2"}},"content":"## kotlin collection \uad00\ub828 \ud568\uc218\ub4e4\uc744 \ud65c\uc6a9\ud558\uc5ec \ucf54\ub4dc\ub97c \ub354 \uae54\ub054\ud558\uac8c \ub9ac\ud329\ud1a0\ub9c1 \ud574\ubcf4\uc790!\\n\\nkotlin collection \uad00\ub828 \ud568\uc218\uc5d0\ub294 \uc544\uc8fc \ub9ce\uc740 \uac83\ub4e4\uc774 \uc788\uc73c\uba70, \uadf8 \uc911 map\uc744 \uc774\uc6a9\ud558\uc5ec \ubc18\ubcf5\ubb38\uc744 \uc0ac\uc6a9\ud55c \ucf54\ub4dc\ub97c \ubcf4\ub2e4 \uae54\ub054\ud558\uac8c \ub9ac\ud329\ud1a0\ub9c1\ud558\uc600\ub2e4.\\n\\n\uac19\uc774 \uc2a4\ud130\ub514\ub97c \ud558\ub294 \uc2a4\ud130\ub514\uc6d0\ubd84\uc758 \ucf54\ub4dc \ub9ac\ubdf0\ub97c \ud1b5\ud574 map\uc744 \ud65c\uc6a9\ud558\uc5ec \ucf54\ub4dc\ub97c \uc218\uc815\ud574\ubcf4\ub294 \uac83\uc774 \uc5b4\ub5bb\uaca0\ub0d0\ub294 \uc870\uc5b8\uc744 \uc5bb\uc5c8\uace0 \ucf54\ub4dc\ub97c \uc218\uc815\ud558\uba74\uc11c map\uc744 \uc0ac\uc6a9\ud568\uc73c\ub85c\uc368 \uc5bb\uc5c8\ub358 \uac10\uc815\uc744 \uae30\uc5b5\ud574\ubcf4\uace0\uc790, \ubcc4\uac70\uc544\ub2d0 \uc218 \uc788\uc9c0\ub9cc \ud754\uc801\uc744 \ub0a8\uaca8\ubcf8\ub2e4.\\n\\n\uc8fc\uc5b4\uc9c4 \uc0c1\ud669\uc740 \uc8fc\ubb38 \uc0dd\uc131 \ub85c\uc9c1\uc774\ub2e4. \ud574\ub2f9 \ub85c\uc9c1\uc740 \uc544\ub798\uc640 \uac19\ub2e4.\\n\\nstep 1. \uac00\uac8c\uc5d0\uc11c \uc74c\uc2dd \uc8fc\ubb38\uc744 \ubc1b\ub294\ub2e4.\\n\\nstep 2. \uc8fc\ubb38 \ub0b4\uc5ed\uc744 db\uc5d0 \uc800\uc7a5\ud558\ub294 \ub85c\uc9c1\uc744 \uc218\ud589\ud55c\ub2e4.\\n\\nstep 3. \ud558\ub098\uc758 \uc8fc\ubb38\uc5d0\ub294 \uc5ec\ub7ec\uac1c\uc758 orderMenu\uac00 \uc874\uc7ac\ud558\uace0, \uc8fc\ubb38\uc5d0 \uba54\ub274\ub4e4\uc740 list\ub85c \ubc1b\ub294\ub2e4. \uc989, \uac01\uac01\uc758 \uba54\ub274\ub4e4\uc744 \ubc18\ubcf5\ubb38\uc73c\ub85c \uc870\ud68c\ud558\uc5ec \ud558\ub098 \uc529 order_menu table(db)\uc5d0 \uc800\uc7a5\ud574\uc900\ub2e4.\\n\\n\ud574\ub2f9 \ub85c\uc9c1\uc758 \uc0ad\uc81c\ub41c \ucf54\ub4dc\uc640 \ucd94\uac00\ub41c \ucf54\ub4dc\ub294 \uc544\ub798\uc640 \uac19\ub2e4.\\n\\n![02-27-1.png](image/02-27-1.png)\\n\\n\ucf54\ud2c0\ub9b0\uc5d0\uc11c\ub294 \ub78c\ub2e4 \ud45c\ud604\uc2dd\uc5d0\uc11c \ub2e8\uc77c \ub9e4\uac1c\ubcc0\uc218\uc758 \uc774\ub984\uc744 it\uc73c\ub85c \ubd80\ub974\uae30\ub85c \uc57d\uc18d\ub418\uc5b4\uc788\ub2e4.\\n\\nmap\ud568\uc218\ub97c \uc801\uc6a9\ud568\uc73c\ub85c\uc368, \ucf54\ub4dc\ub3c4 \uac04\uacb0\ud574\uc9c0\uace0, \uc774\ud574\ub3c4 \uc9c1\uad00\uc801\uc73c\ub85c \uc798\ub418\ub294 \ucf54\ub4dc\uac00 \ub418\uc5c8\ub2e4.\\n\\n\uc0c8\ub85c\uc6b4 \uc5b8\uc5b4(\ucf54\ud2c0\ub9b0)\uc744 \uc775\ud788\uba74\uc11c \uc544\uc9c1 \uc2a4\ud504\ub9c1\ub3c4 \uacc4\uc18d\ud574\uc11c \uae4a\uc774\ub97c \ub354\ud574\uac00\uace0 \uc788\ub294 \uc0c1\ud669\uc774\uae30 \ub54c\ubb38\uc5d0 \uae30\ubcf8\uc801\uc778 \uad6c\ubb38\uc73c\ub85c \uad6c\ud604\uc774 \ub41c\ub2e4\uba74 \uad73\uc774 \uac19\uc740 \uae30\ub2a5\uc744 \ud558\ub294 \ud568\uc218\ub4f1\uc744 \ucc3e\uc544\ubcf4\uace0 \ucf54\ub4dc\uc758 \uc9c8\uc744 \ub354 \ub192\uc774\ub824\ub294 \uc2dc\ub3c4\ub294 \ud558\uc9c0 \uc54a\uc558\ub2e4.(\ubabb\ud588\ub2e4..?)\uadfc\ub370 \uc774\ubc88 \uc2a4\ud130\ub514\uc5d0\uc11c \ub85c\uc9c1 \ubc0f \ucf54\ub4dc\uc758 \uac1c\uc120\uc5d0 \ub300\ud55c \uc758\uacac\uc744 \ubc1b\uc73c\uba74\uc11c, \uc55e\uc73c\ub85c \ub354 \uacf5\ubd80\ud558\uace0 \ubc1c\uc804\ud574\uc57c\ud560 \uc694\uc18c\ub4e4\uc774 \ub9ce\uad6c\ub098 \ud558\ub294 \uc0dd\uac01\uc744 \ud588\ub2e4. :)"},{"id":"knowledge2","metadata":{"permalink":"/Blog/blog/knowledge2","editUrl":"https://github.com/facebook/docusaurus/edit/main/website/blog/blog/2022-01-21-knowledge2.mdx","source":"@site/blog/2022-01-21-knowledge2.mdx","title":"1\uc6d4 21\uc77c\uc758 \uae68\ub2ec\uc74c","description":"\ucf54\ud2c0\ub9b0\uc73c\ub85c \ud568\uc218\ud615 \uc5b8\uc5b4\ub97c \ubc30\uc6cc\ubcf4\uc790!","date":"2022-01-21T00:00:00.000Z","formattedDate":"January 21, 2022","tags":[{"label":"knowledge","permalink":"/Blog/blog/tags/knowledge"}],"readingTime":6.815,"truncated":false,"authors":[{"name":"Lim SeongKyu","title":"BE","url":"https://github.com/seongkyu-lim","imageURL":"https://github.com/seongkyu-lim.png","key":"seongkyu"}],"prevItem":{"title":"2\uc6d4 27\uc77c\uc758 \uae68\ub2ec\uc74c","permalink":"/Blog/blog/knowledge3"},"nextItem":{"title":"1\uc6d4 15\uc77c\uc758 \uae68\ub2ec\uc74c","permalink":"/Blog/blog/knowledge1"}},"content":"## \ucf54\ud2c0\ub9b0\uc73c\ub85c \ud568\uc218\ud615 \uc5b8\uc5b4\ub97c \ubc30\uc6cc\ubcf4\uc790!\\n\\n\ucf54\ud2c0\ub9b0\uc740 \ud568\uc218\ud615 \uc5b8\uc5b4\uc774\uba74\uc11c \ub3d9\uc2dc\uc5d0 \uac1d\uccb4 \uc9c0\ud5a5\uc801 \uc5b8\uc5b4\uc774\uae30\ub3c4\ud55c \ub2e4\uc911 \ud328\ub7ec\ub2e4\uc784 \uc5b8\uc5b4\uc774\ub2e4. \ucf54\ud2c0\ub9b0 \uc774\uc804\uc5d0 \uc0ac\uc6a9\uc744 \ud558\ub358 \uc790\ubc14 \ub610\ud55c \uc790\ubc14 8\ubd80\ud130 \ud568\uc218\ud615 \uc5b8\uc5b4\ub85c\uc368\uc758 \uae30\ub2a5\ub4e4\uc744 \uc9c0\uc6d0\ud558\uae30 \uc2dc\uc791\ud588\ub2e4. \ucf54\ud2c0\ub9b0\uc744 \uc0ac\uc6a9\ud558\uba74\uc11c \ud568\uc218\ud615 \uc5b8\uc5b4\ub97c \ud55c\ubc88 \uacf5\ubd80\ud574\ubcf4\uace0 \uc0ac\uc6a9\ud574\ubcf4\uc790\ub77c\ub294 \uc0dd\uac01\uc774 \ub4e4\uc5c8\uace0 \uc624\ub298\uc740 \ud568\uc218\ud615 \uc5b8\uc5b4\uc5d0 \ub300\ud55c \uc9c0\uc2dd\uc744 \uc775\ud600\ubcf4\uc790.\\n\\n### \ud568\uc218\ud615 \uc5b8\uc5b4\ub780 ?\\n\\n\ud568\uc218\ud615 \ud504\ub85c\uadf8\ub798\ubc0d\uc740 \uc790\ub8cc \ucc98\ub9ac\ub97c \uc218\ud559\uc801 \ud568\uc218\uc758 \uacc4\uc0b0\uc73c\ub85c \ucde8\uae09\ud558\uace0  <span style={{color: \'#ff7f00\'}}>\uc0c1\ud0dc</span>\uc640  <span style={{color: \'#ff7f00\'}}>\uac00\ubcc0 \ub370\uc774\ud130</span>\ub97c \uba40\ub9ac\ud558\ub294 \ud504\ub85c\uadf8\ub798\ubc0d \ud328\ub7ec\ub2e4\uc784\uc758 \ud558\ub098\uc774\ub2e4. \uba85\ub839\ud615 \ud504\ub85c\uadf8\ub798\ubc0d\uc5d0\uc11c\ub294 \uc0c1\ud0dc\ub97c \ubc14\uafb8\ub294 \uac83\uc744 \uac15\uc870\ud558\ub294 \uac83\uacfc\ub294 \ub2ec\ub9ac, \ud568\uc218\ud615 \ud504\ub85c\uadf8\ub798\ubc0d\uc740 \ud568\uc218\uc758 \uc751\uc6a9\uc744 \uac15\uc870\ud55c\ub2e4.[\uc704\ud0a4\ubc31\uacfc]\\n\\n### \ud568\uc218\ud615 \uc5b8\uc5b4\ub294 \uac1d\uccb4 \uc9c0\ud5a5\uc801 \uc5b8\uc5b4\uc640 \ubb34\uc5c7\uc774 \ub2e4\ub978\uac00 ?\\n\\n\ub0b4\uac00 \uc9c0\uae08 \uc774\ud574\ud558\uace0 \uc788\ub294 \ud328\ub7ec\ub2e4\uc784\uc740 \uac1d\uccb4 \uc9c0\ud5a5, \uc808\ucc28 \uc9c0\ud5a5 \uc815\ub3c4\uc774\ub2e4. \uc808\ucc28 \uc9c0\ud5a5\uc758 \ucf54\ub4dc\ub97c C\uc5b8\uc5b4\ub97c \ud1b5\ud574 \ubc30\uc6b0\uace0 Java\uc640 Python\uc73c\ub85c \uac1d\uccb4 \uc9c0\ud5a5\uc801\uc778 \uac1c\ub150\ub4e4\uc744 \ubc30\uc6b0\uace0 \uc0ac\uc6a9\ud558\uba74\uc11c, \ucf54\ub4dc\ub97c \uc774\ub7f0\uc2dd\uc73c\ub85c \uc9e4 \uc218 \uc788\uad6c\ub098..! \ucc38 \ud604\uc2e4\uc758 \ub3d9\uc791\uacfc \ube44\uc2b7\ud558\uac8c \uc9dc\ub294 \uac83\uc774 \uc88b\ub2e4..!\ub77c\ub294 \uac10\uba85\uc744 \ubc1b\uc558\uc5c8\ub294\ub370, \ud568\uc218\ud615 \uc5b8\uc5b4\ub294 \ub610 \ubb50\uc9c0 ..?  \uac1d\uccb4 \uc9c0\ud5a5\uc801\uc73c\ub85c \uc9dc\ub294 \uac83\ub3c4 \ucda9\ubd84\ud788 \ubd88\ud3b8\ud558\uac70\ub098 \uc548\uc88b\uc740 \uc810\uc774 \uc5c6\ub294 \uac83 \uac19\uc740\ub370 ? \ub77c\ub294 \uc0dd\uac01\uc774 \ub4e4\uc5c8\ub2e4.\\n\\n\ubd84\uba85 \uc790\ubc14\uc5d0\uc11c\ub3c4 \ud568\uc218\ud615 \uc5b8\uc5b4\ub85c\uc368\uc758 \uae30\ub2a5\uc744 \ub3c4\uc785\ud558\uace0, \ucf54\ud2c0\ub9b0\ub3c4 \ud568\uc218\ud615 \uc5b8\uc5b4\ub85c\uc758 \uad6c\ud604\uc774 \uc798\ub418\uc5b4\uc788\ub2e4\ub77c\ub294 \ub9d0\uc744 \ub4e4\uc5c8\uc5c8\uae30\uc5d0, \ud568\uc218\ud615 \uc5b8\uc5b4\ub294 \ub610 \ub2e4\ub978 \ub9e4\ub825\uacfc \uc7a5\uc810\uc774 \uc788\uad6c\ub098 \ud558\ub294 \uc0dd\uac01\uc774 \ub4e4\uc5c8\uace0, \ud568\uc218\ud615 \uc5b8\uc5b4\uac00 \uc5b4\ub5a4 \uac83\uc778\uc9c0 \uc54c\uc544\ubcf4\uae30\uc704\ud574 \ud5ec\uc2a4\uc7a5\uc5d0\uc11c \uc720\ud29c\ube0c\ub85c \ud568\uc218\ud615 \uc5b8\uc5b4 \uad00\ub828 \uc601\uc0c1\uc744 \ub4e4\uc5c8\ub2e4. \ud574\ub2f9 \uc601\uc0c1\uc5d0\uc11c \ud568\uc218\ud615 \uc5b8\uc5b4\uc640 \uac1d\uccb4\uc9c0\ud5a5\uc801 \uc5b8\uc5b4\uc758 \ucc28\uc774\uc810\uc744 \uacf5\uc7a5\uc758 \ud504\ub85c\uc138\uc2a4\uc5d0 \ube44\uc720\ud558\uc5ec \uc124\uba85\ud574\uc8fc\ub294\ub370 \uadf8 \uc124\uba85\uc744 \ub4e3\uace0 \uc544\uc8fc \uc798 \uc774\ud574\ub97c \ud558\uc600\ub2e4.\\n\\n\uc601\uc0c1\ub9c1\ud06c\ub294 \ud558\ub2e8\uc758 \ucc38\uace0\uc790\ub8cc\uc5d0 \uc788\ub2e4.\\n\\n\uc601\uc0c1\uc758 \ub0b4\uc6a9\uc744 \uac04\ub2e8\ud788 \uc815\ub9ac\ud558\uba74  <span style={{color: \'#ff00ff\'}}>\ud568\uc218\ud615\uc5b8\uc5b4\ub294 \ud568\uc218\uc758 \ub3d9\uc791\uc73c\ub85c \uc9c4\ud589\ub418\uba70 \uac01\uac01\uc758 \ud568\uc218\ub294 \uc678\ubd80\uc758 \uc5b4\ub5a0\ud55c \uc0c1\ud0dc \ubc0f \ubcc0\uc218\uc758 \uac12\uc744 \ubcc0\ud654\uc2dc\ud0a4\uc9c0 \uc54a\uace0 \ud56d\uc0c1 \uac19\uc740 \uc778\uc790\uc5d0 \ub300\ud574 \uac19\uc740 \uacb0\uacfc\uac12\uc744 \ubc18\ud658\ud55c\ub2e4. \uc989 \ud568\uc218\ud615 \uc5b8\uc5b4\ub97c \uc0ac\uc6a9\ud558\uba74 \uadf8\ub0e5 \ud544\uc694\ud55c \ud568\uc218\ub4e4\uc744 \uc120\ud0dd\ud574\uc11c \ub098\uc5f4\ud558\uba74 \ub418\ub294 \uac83\uc774\ub2e4.. \uc774\ub807\uac8c \ud568\uc73c\ub85c\uc368  \uc678\ubd80\uc758 \ubcc0\ud654\ub85c\uc778\ud55c \uc624\ub958, \ud2b9\uc815 \ud504\ub85c\uc138\uc2a4\uc5d0\uc11c \ubc1c\uc0dd\ud55c \uc624\ub958\uac00 \ub2e4\ub978 \ud504\ub85c\uc138\uc2a4\uc5d0 \uc601\ud5a5\uc744 \ubbf8\uce58\ub294 \ub4f1\uc758 \ubd80\uc791\uc6a9\uc73c\ub85c\ubd80\ud130 \uc790\uc720\ub85c\uc6cc \uc9c4\ub2e4.</span>\\n\\n\uc9d1\uc5d0 \ub3cc\uc544\uc640 \ud568\uc218\ud615 \uc5b8\uc5b4\ub97c \uac80\uc0c9\ud574\ubcf4\ub2c8 \uacf5\ud1b5\uc801\uc73c\ub85c \uace0\ucc28\ud568\uc218, \ub78c\ub2e4, \uc21c\uc218 \ud568\uc218\uc640 \uac19\uc740 \ud0a4\uc6cc\ub4dc\uac00 \ub208\uc5d0 \ub9ce\uc774 \ub748\ub2e4. \uadf8\ub7ec\uba74 \uc6b0\uc120 \uc774 \uc138\uac1c \ud0a4\uc6cc\ub4dc\uc758 \uc758\ubbf8\ubd80\ud130 \ud30c\uc545\ud574\ubcf4\uc790.\\n\\n### \ub78c\ub2e4 :\\n\\n\ub2e4\ub978 \ud568\uc218\uc758 \uc778\uc790\ub85c \ub118\uae30\ub294 <span style={{color: \'#ff7f00\'}}>\ud568\uc218</span>, \ud568\uc218\uc758 \uacb0\uad0f\uac12\uc73c\ub85c \ubc18\ud658\ud558\ub294 <span style={{color: \'#ff7f00\'}}>\ud568\uc218</span>, \ubcc0\uc218\uc5d0 \uc800\uc7a5\ud558\ub294 <span style={{color: \'#ff7f00\'}}>\ud568\uc218</span>\ub97c \ub9d0\ud55c\ub2e4.\\n\\n\ub2e4\ub978 \ud568\uc218\uc758 \uc778\uc790\ub85c \ud568\uc218\ub97c \ub118\uae34\ub2e4\uace0..?, \ud568\uc218\uc758 \ubc18\ud658\uac12\uc73c\ub85c \ud568\uc218\ub97c \ubc18\ud658\ud55c\ub2e4..? \ubcc0\uc218\uc5d0 \ud568\uc218\ub97c \uc800\uc7a5\ud55c\ub2e4 ..? \uc774\uac8c \ubb34\uc2a8 \ub9d0\uc778\uc9c0 \uc774\ud574\uac00 \uc5b4\ub835\ub2e4.. \uc774\ub97c \uc54c\ub824\uba74 \uace0\ucc28 \ud568\uc218\uc758 \uac1c\ub150\uc744 \uc54c\uc544\uc57c\ud55c\ub2e4.\\n\\n### \uace0\ucc28 \ud568\uc218 :\\n\\n\uace0\ucc28\ud568\uc218\ub294 \ud568\uc218\ub97c \uc77c\ubc18 \uc790\ub8cc\ud615\uc774\ub098 \uac1d\uccb4\ucc98\ub7fc \uc778\uc790\ub85c \ubc1b\uac70\ub098, \ub9ac\ud134\ud560 \uc218 \uc788\ub294 \ud568\uc218\uc774\ub2e4.\\n\\n\uc774\ub984\ub9cc \uace0\ucc28\ud568\uc218\uc774\uc9c0 \uc0ac\uc6a9\ubc95\uc740 \uc77c\ubc18 \ud568\uc218\uc640 \uac19\ub2e4. \ub2e4\ub9cc \ud568\uc218\uc758 \uc778\uc790\ub85c \ud568\uc218\ub97c \ubc1b\uc744 \uc218 \uc788\uace0, \ub9ac\ud134\ub3c4 \ud568\uc218\ub97c \ub9ac\ud134\ud560 \uc218 \uc788\ub294 \uac83\uc774\ub2e4. \ub530\ub77c\uc11c \ud568\uc218\ub97c \uc778\uc790\ub85c \ubc1b\uc744 \ub54c\ub294 \uc778\uc790\uc5d0 \uc815\uc758\ud558\ub294 \ubd80\ubd84\uc744 \ub78c\ub2e4 \ud45c\ud604\uc2dd\uc744 \uc774\uc6a9\ud574 \ud45c\uae30\ud55c\ub2e4.\\n\\n```kotlin\\n\\n//function1\uc740 \uc778\uc790\ub85c \ub9e4\uac1c\ubcc0\uc218\uac00 \uc5c6\uace0, \ubc18\ud658\uac12 \ub610\ud55c \uc5c6\ub294 \ud568\uc218\ub97c \ubc1b\ub294\ub2e4. \ub530\ub77c\uc11c \uace0\ucc28\ud568\uc218\uc774\ub2e4.\\nfun funtion1(f: ()->Unit){\\n\\tf()\\n}\\n\\n//function2\ub294 \uc778\uc790\ub85c String\uacfc \uc778\uc790\ub97c Int\ub450\uac1c\ub97c \ubc1b\uace0 String\uc744 \ubc18\ud658\ud558\ub294 \ud568\uc218\ub97c \ubc1b\ub294\ub2e4. \ub530\ub77c\uc11c \uace0\ucc28\ud568\uc218\uc774\ub2e4.\\nfun function2(f: (Int,Int)->String, str: String){\\n\\tprintln(str)\\n\\tprintln(f())\\n}\\n```\\n\\n### \uc21c\uc218 \ud568\uc218 :\\n\\n\uc21c\uc218 \ud568\uc218\ub294 \uac19\uc740 \uc778\uc790\uc5d0 \ub300\ud558\uc5ec \ud56d\uc0c1 \uac19\uc740 \uac12\uc744 \ubc18\ud658\ud55c\ub2e4. \uadf8\ub9ac\uace0 \uc21c\uc218 \ud568\uc218\ub294 \ud568\uc218 \uc678\ubd80\uc758 \uc5b4\ub5a4 \uc0c1\ud0dc\ub3c4 \ubc14\uafb8\uc9c0 \uc54a\ub294\ub2e4.\\n\\n\uc989, \ud5ec\uc2a4\uc7a5\uc5d0\uc11c \ub4e4\uc5c8\ub358 \ud568\uc218\ud615 \uc5b8\uc5b4\uc758 \uac1c\ub150\uad00\ub828 \uc720\ud29c\ube0c \ub0b4\uc6a9\uacfc \uc5f0\uad00\uc9c0\uc5b4 \uc138\uac1c\uc758 \ud0a4\uc6cc\ub4dc\ub97c \uc870\ud569\ud574\ubcf4\uba74, \ud568\uc218\ud615 \uc5b8\uc5b4\ub294 <span style={{color: \'#ff00ff\'}}>\uc5f0\uc18d\ub41c \ud568\uc218\uc758 \ub3d9\uc791\uc73c\ub85c \ucf54\ub4dc\uac00 \uc2e4\ud589\ub418\uba70, \uc21c\uc218\ud568\uc218\ub97c \uc0ac\uc6a9\ud558\uc5ec \ubd80\uc791\uc6a9\uc744 \uc904\uc774\uace0 \uadf8 \uc21c\uc218\ud568\uc218\ub4e4\uc740 \ub78c\ub2e4 \ud45c\ud604\uc2dd\uc744 \uc774\uc6a9\ud558\uc5ec \uc9e4 \uc218 \uc788\ub2e4!</span>\\n\\n\ucc38\uace0\uc790\ub8cc :\\n\\n[https://www.youtube.com/watch?v=jVG5jvOzu9Y](https://www.youtube.com/watch?v=jVG5jvOzu9Y)\\n\\n[https://kotlinlang.org/docs/home.html](https://kotlinlang.org/docs/home.html)"},{"id":"knowledge1","metadata":{"permalink":"/Blog/blog/knowledge1","editUrl":"https://github.com/facebook/docusaurus/edit/main/website/blog/blog/2022-01-15-knowledge1.mdx","source":"@site/blog/2022-01-15-knowledge1.mdx","title":"1\uc6d4 15\uc77c\uc758 \uae68\ub2ec\uc74c","description":"\ucf54\ud504\ub9c1 (\ucf54\ud2c0\ub9b0 + \uc2a4\ud504\ub9c1)\uc5d0\uc11c entity\ub294 \uc790\ubc14+\uc2a4\ud504\ub9c1\uc5d0\uc11c \uc0ac\uc6a9\ud558\ub294 \ubc29\ubc95\uacfc \uc5b4\ub5bb\uac8c \ub2e4\ub97c\uae4c ?","date":"2022-01-15T00:00:00.000Z","formattedDate":"January 15, 2022","tags":[{"label":"knowledge","permalink":"/Blog/blog/tags/knowledge"}],"readingTime":9.365,"truncated":false,"authors":[{"name":"Lim SeongKyu","title":"BE","url":"https://github.com/seongkyu-lim","imageURL":"https://github.com/seongkyu-lim.png","key":"seongkyu"}],"prevItem":{"title":"1\uc6d4 21\uc77c\uc758 \uae68\ub2ec\uc74c","permalink":"/Blog/blog/knowledge2"},"nextItem":{"title":"1\uc6d4 3\uc77c\uc758 \uc0dd\uac01","permalink":"/Blog/blog/thingking"}},"content":"### \ucf54\ud504\ub9c1 (\ucf54\ud2c0\ub9b0 + \uc2a4\ud504\ub9c1)\uc5d0\uc11c entity\ub294 \uc790\ubc14+\uc2a4\ud504\ub9c1\uc5d0\uc11c \uc0ac\uc6a9\ud558\ub294 \ubc29\ubc95\uacfc \uc5b4\ub5bb\uac8c \ub2e4\ub97c\uae4c ?\\n\\n12\uc6d4 \ub9d0\ubd80\ud130 \uc2dc\uc791\ud55c \ucf54\ud2c0\ub9b0 + \uc2a4\ud504\ub9c1 \uc628\ub77c\uc778 \uc2a4\ud130\ub514 \ubaa8\uc784\uc5d0\uc11c \ucf54\ud2c0\ub9b0\uc5d0 \ub300\ud55c \uae30\ubcf8\uc801\uc778 \ubb38\ubc95 \uacf5\ubd80\ub97c \ub9c8\uce58\uace0 \uac04\ub2e8\ud55c \ud504\ub85c\uc81d\ud2b8\ub97c \uae30\ud68d\ud558\uace0 \uc2dc\uc791\ud558\uac8c \ub418\uc5c8\ub2e4.\\n\\n\uc2a4\ud130\ub514\uc758 \ubaa9\uc801\uc774 \ucf54\ud2c0\ub9b0 \uc790\uccb4\uc758 \uc5b8\uc5b4\ub97c \ud559\uc2b5\ud558\uace0 \uc2a4\ud504\ub9c1\uc5d0 \uc801\uc6a9\ud574\ubcf4\ub294 \uac83\uc774 \ubaa9\uc801\uc774\uc5c8\uae30\uc5d0 \ud504\ub85c\uc81d\ud2b8\uc758 \uae30\ud68d\uc740 \ub530\ub85c \ud558\uc9c0 \uc54a\uace0 next-step\uc774\ub77c\ub294 \uad50\uc721 \ub2e8\uccb4\uc5d0\uc11c \uc9c4\ud589\ud55c \uc74c\uc2dd\uc810\uc5d0\uc11c \uc0ac\uc6a9\ud558\ub294 \uc8fc\ubb38 \ud3ec\uc2a4\uae30 \ud504\ub85c\uc81d\ud2b8\ub97c \ucc28\uc6a9\ud558\uc600\ub2e4. \uc804\uccb4\uc801\uc778 \ud2c0\uc740 \ucc28\uc6a9\ud558\uace0 \uc138\ubd80\uc801\uc73c\ub85c \uad6c\ud604\ud560 \uac83\uc5d0 \ub300\ud574\uc11c\ub294 \ud300\uc6d0\ubd84\ub4e4\uacfc \uc774\uc57c\uae30\ub97c \ub098\ub204\uba70 \uad6c\uccb4\ud654\ud574 \ub098\uac14\ub2e4. er-diagram\uc744 \uc9dc\uace0, \ud658\uacbd \uc138\ud305\uc744 \ud604\uc9c1\uc5d0\uc11c \ucf54\ud2c0\ub9b0\uc73c\ub85c \uc2a4\ud504\ub9c1\uc744 \ub2e4\ub8e8\uace0 \uacc4\uc2e0 \uc2a4\ud130\ub514\uc7a5\ub2d8\uaed8\uc11c \ub9e1\uc544 \ud574\uc8fc\uc168\uace0, \uc8fc\ubb38, \uc0c1\ud488, \ubc30\ub2ec, \uba54\ub274(\uc0c1\ud488\uc758 \uc9d1\ud569)\uc73c\ub85c \ub3c4\uba54\uc778\uc744 \ub098\ub204\uc5c8\uace0 \ub098\ub294 \uc8fc\ubb38 \ub85c\uc9c1\uc744 \ub9e1\uc544 \uc9c4\ud589\uc744 \ud558\uac8c \ub418\uc5c8\ub2e4.\\n\\ner-diagram\uc774 \ub9cc\ub4e4\uc5b4 \uc84c\uc73c\ub2c8 \uc2a4\ud504\ub9c1\uc5d0\uc11c DB\uc5d0 \uc4f0\uc77c \ud544\ub4dc\uc640 \ud14c\uc774\ube14\uad00\uc758 \uc5f0\uad00\uad00\uacc4 \uc124\uc815\uc744 \uc704\ud574 entity\ub97c \ub9cc\ub4dc\ub294 \uc791\uc5c5\uc744 \uc2dc\uc791\ud558\uc600\ub2e4.\\n\\n\ud504\ub85c\uc81d\ud2b8\ub97c \uc9c4\ud589\ud558\uae30 \uc804\uc5d0 \uacf5\ubd80\ud55c \ucf54\ud2c0\ub9b0 \ubb38\ubc95\uc744 \ubc14\ud0d5\uc73c\ub85c java+spring\uc5d0\uc11c entity\ub97c \ub9cc\ub4e4\uc5b4\uc8fc\ub4ef\uc774 \ucf54\ub4dc\ub97c \uc368\ub0b4\ub824\uac14\ub2e4.\\n\\n\uc0ac\uc6a9\uc5b8\uc5b4\uac00 \ucf54\ud2c0\ub9b0\uc774\ub4e0 \uc790\ubc14\ub4e0, \uc2a4\ud504\ub9c1\uc5d0\uc11c \uc9c0\uc6d0\ud558\ub294 \uae30\ub2a5\uc740 \uc5b8\uc5b4\uc640 \ubb34\uad00\ud558\uac8c \ub3d9\uc77c\ud55c \ubb38\ubc95\uc77c \uac83\uc774\uae30 \ub54c\ubb38\uc5d0, \ud3c9\uc18c\uc5d0 \uc9dc\ub4ef\uc774 \ud074\ub798\uc2a4\uc5d0 \uc774 \ud074\ub798\uc2a4\uac00 entity\uc784\uc744 \uc54c\ub824\uc8fc\uace0 \ube48\ub4f1\ub85d\uc744 \uc704\ud55c @Entity\uc744 \ubd99\uc5ec\uc8fc\uace0, id \uceec\ub7fc\uc744 \ub9cc\ub4e4\uc5b4\uc8fc\uace0, \ud544\ub4dc\ub4e4\uc744 \uc0dd\uc131\ud574\uc92c\ub2e4.\\n\\n\ucf54\ud2c0\ub9b0\uc740 \ud574\ub2f9 \ubcc0\uc218\uac00 \ubd88\ubcc0\uc774\uba74 val, \uac00\ubcc0\uc774\uba74 var\uc744 \uba85\uc2dc\ud574\uc8fc\ubbc0\ub85c, \uccab \ubc88\uc9f8 \uace0\ubbfc\uc5d0 \ube60\uc84c\ub2e4.. entity\uc758 \uac01 \ud544\ub4dc\ub294 \ubd88\ubcc0\uc73c\ub85c \uc120\uc5b8\ud558\ub294 \uac83\uc774 \ub9de\uc744\uae4c? \uc544\ub2c8\uba74 \uac00\ubcc0\uc73c\ub85c \uc120\uc5b8\ud558\ub294 \uac83\uc774 \ub9de\uc744\uae4c? .. \uc870\uae08\uc758 \uace0\ubbfc \ub05d\uc5d0 var\ub85c \uc6b0\uc120 \uc120\uc5b8\uc744 \ud574\uc8fc\uc5c8\ub2e4.\\n\\n\uac00\ubcc0\uc73c\ub85c \uc120\uc5b8\ud574\uc900 \uc774\uc720\ub294, \ud2b9\uc815 \ud544\ub4dc\ub97c \uc5c5\ub370\uc774\ud2b8\ud558\ub294 \ub85c\uc9c1\uacfc \uac19\uc740 \uacbd\uc6b0\uc5d0, entity\uc5d0 \ub514\ube44\uc758 \ub370\uc774\ud130\ub97c \ubd88\ub7ec\uc640 \ud2b9\uc815 \ud544\ub4dc\ub97c <span style={{color: \'#ff7f00\'}}>\uc218\uc815</span>\ud574\uc8fc\uc5b4\uc57c\ud558\ub294\ub370 \uc774\ub7ec\ud55c \uc0c1\ud669\uc5d0\uc11c \ud574\ub2f9 \ud544\ub4dc\uac00 \ubd88\ubcc0\uc774\uba74 \uc218\uc815\uc774 \uc548\ub420 \uac83\uc774\uae30 \ub54c\ubb38\uc774\ub2e4..!\\n\\n\ucf54\ud504\ub9c1\uc744 \uc2dc\uc791\ud558\uace0 \ub9c8\ub531\ub4dc\ub9b0 \uccab \ubc88\uc9f8 \uace0\ubbfc\uc740 \uc774\ub807\uac8c \ud574\uacb0\uc744 \ud558\uc600\uace0,, \ucf54\ud2c0\ub9b0\uc5d0\uc11c\ub294 \ubcc0\uc218\uc758 \ud0c0\uc785\uc744 \ud6c4\uc704\uc5d0 \u2018:\u2019 \ud0a4\uc6cc\ub4dc \ub2e4\uc74c\uc5d0 \ubd99\uc5ec \uc8fc\ubbc0\ub85c \uacf5\ubd80\ud588\ub358\ub300\ub85c \ud544\ub4dc\ub97c \uc815\uc131\uc2a4\ub808 \ub9cc\ub4e4\uc5b4\uc900\ub2e4.\\n\\nid\uc5d0 \ud574\ub2f9\ud558\ub294 \ud544\ub4dc\uc5d0 @Id\uc5b4\ub178\ud14c\uc774\uc158\uacfc \uc0dd\uc131 \uc804\ub7b5\ub3c4 IDENTITY\ub85c \uc124\uc815\uc744 \ud574\uc900\ub2e4.\\n\\n\uc544 \ub9de\ub2e4, \ucf54\ud2c0\ub9b0\uc5d0\uc11c\ub294 \uacf5\ud3ec\uc758 nullPointerException\uc5d0 \ub300\ud574 \uc644\uc804\ud55c \uc548\uc804\uc131\uc744 \uc8fc\uae30 \uc704\ud574, \ubcc0\uc218\uac00 null\uc774 \uac00\ub2a5\ud55c\uc9c0 \uc544\ub2cc\uc9c0\ub97c \u2018?\u2019\uae30\ud638 \ud558\ub098\ub85c \uba85\uc2dc\ud574\uc904 \uc218 \uc788\ub2e4. ?\uac00 \ud0c0\uc785\ub4a4\uc5d0 \ubd99\uac8c\ub418\uba74 nullable\ud55c \ubcc0\uc218\uac00 \ub418\uace0 ?\uac00 \uc5c6\uc73c\uba74 non-null\uc778 \ubcc0\uc218\uac00 \ub418\ub294 \uac83\uc774\ub2e4..!\\n\\n\ub450 \ubc88\uc9f8 \uace0\ubbfc\uc774 \ub4e0\ub2e4.. \uc5d4\ud130\ud2f0\uc758 \ud544\ub4dc\ub4e4\uc740 nullable\ud574\uc57c\ud560\uae4c? \uc544\ub2c8\uba74 non-null\uc774\uc5b4\uc57c\ud560\uae4c ?\\n\\n\uc790\ubc14\ub85c \uc5d4\ud130\ud2f0\ub97c \ub9cc\ub4e4 \ub54c\ub97c \ub2e4\uc2dc \ub5a0\uc62c\ub824\ubcf4\uc790.. \ud574\ub2f9 \ud544\ub4dc\uac00 \ube48\uac12\uc73c\ub85c \ub514\ube44\uc5d0 \uc800\uc7a5\ub418\uba74 \uc548\ub420\uacbd\uc6b0\uc5d0, @NotNull\ub85c null\uc774\uba74 \uc548\ub41c\ub2e4\ub294 \uac83\uc744 \uba85\uc2dc\ud574\uc8fc\uc5c8\ub2e4. \uc5b4\ub77c, kotlin\uc5d0\uc11c\ub294 db\uc5d0 \ub123\uae30 \ud55c\ucc38 \uc804\uc5d0, \ucd5c\ucd08\uc5d0 \ub514\ube44\uc5d0 \ub123\uae30\uc704\ud55c entity \ub370\uc774\ud130\ub97c \ub9cc\ub4dc\ub294 \uc21c\uac04\uc5d0 \uc5b8\uc5b4\uc801 \ucc28\uc6d0\uc5d0\uc11c <span style={{color: \'#ff7f00\'}}>?\ud0a4\uc6cc\ub4dc\ud558\ub098\ub85c, \ud574\ub2f9 \ud544\ub4dc\uac00 null\uc774 \uac00\ub2a5\ud55c\uc9c0 \ubd88\uac00\ub2a5\ud55c\uc9c0\ub97c \ucee8\ud2b8\ub864\ud560 \uc218 \uc788\uac8c \ub418\uc5c8\ub2e4.</span> \uadf8\ub7ec\uba74 \ud574\ub2f9 \ud544\ub4dc\uac00 null\uc774\uc5b4\ub3c4 \ub418\ub294\uc9c0 \uc548\ub418\ub294\uc9c0\ub97c \uc0dd\uac01\ud574\ubcf4\uc558\uace0 nullable\uc5ec\ubd80\ub97c \uc124\uc815\ud558\uc5ec \ud574\uacb0\ud558\uc600\ub2e4.\\n\\n\ub9c8\uc9c0\ub9c9\uc73c\ub85c lombok\uc758 \uc5b4\ub178\ud14c\uc774\uc158\ub4e4\ub3c4 \uc5d4\ud130\ud2f0 \ud074\ub798\uc2a4\uc5d0 \ucd94\uac00\ud574 \uc8fc\uc5c8\ub2e4.\\n\\n![code1.png](image/code1.png)\\n\\n\ucf54\ub4dc\ub97c \ub2e4 \uc9dc\uace0 \ubcf4\ub2c8, \uc790\ubc14\ub85c \uc5d4\ud130\ud2f0\ub97c \ub9cc\ub4e4\uc5b4 \uc900\uac70\ub791 \ud06c\uac8c \ub2e4\ub978\uac8c\uc5c6\ub2e4..! \ucf54\ud2c0\ub9b0 \ubb38\ubc95\uc744 \ud559\uc2b5\ud560 \ub54c \ubd84\uba85 \uc5ec\ub7ec \ub2e4\uc591\ud55c \ud074\ub798\uc2a4\ub4e4\uc774 \uc874\uc7ac\ud558\uace0 \uc790\ubc14\uc640\ub294 \ub2e4\ub978 \ubb38\ubc95\ub4e4\uc774 \uc874\uc7ac\ud558\uc600\ub294\ub370, \ub9c9\uc0c1 \uc2a4\ud504\ub9c1\uc5d0 \uc801\uc6a9\ud558\uace0 \ubcf4\ub2c8 \ud3c9\uc18c \uc790\ubc14\ub85c \uc9e0 \ucf54\ub4dc\uc640 \ube44\uc2b7\ud558\ub2e4.. \ub0b4\uac00 \uc544\uc9c1 \ucf54\ud2c0\ub9b0 \ubb38\ubc95\uc744 \uc798 \ud65c\uc6a9\ud558\uc9c0 \ubabb\ud558\ub294 \uac74\uac00 \uc2f6\uc5b4 \ucf54\ud2c0\ub9b0\uc73c\ub85c \ub9cc\ub4e0 entity\ucf54\ub4dc\ub4e4\uc744 \uc870\uc0ac\ud574\ubcf4\uc558\ub2e4.\\n\\n\ub2e4\ub978 \ubd84\ub4e4\uc774 \uc9e0 \ucf54\ub4dc\ub4e4\uc744 \uc5ec\ub7ec\uac1c \ubd10\ubcf4\uace0, \uc6b0\ud558\ud55c \ud14c\ud06c \uc138\ubbf8\ub098\uc5d0\uc11c \uc9c4\ud589\ud55c \ucf54\ud504\ub9c1 \uac15\uc758\ub97c \ubcf4\ub2c8 \uc5ec\ub7ec \uac1c\uc120\uc810\ub4e4\uc774 \ub208\uc5d0 \ub744\uc5c8\ub2e4.\\n\\n\uc6b0\uc120 \uccab \ubc88\uc9f8\ub85c, <span style={{color: \'#ff00ff\'}}>var \uc120\ud0dd\uc5d0 \ub300\ud55c \uc870\uc2ec\uc774 \ud544\uc694\ud558\ub2e4\ub294 \uac83.</span>\\n\\n\ud544\ub4dc\ub4e4\uc744 var\ub85c \uc120\uc5b8\ud55c \uac83\uc740 \uc55e\uc5d0\uc11c \uc124\uba85\ud55c \uc774\uc720\uac00 \ud0c0\ub2f9\ud558\ub2e4\uace0 \uc0dd\uac01\ud55c\ub2e4. \ud558\uc9c0\ub9cc \ucf54\ud2c0\ub9b0\uc740 \uae30\ubcf8\uc801\uc73c\ub85c val\uc744 \uad8c\uc7a5\ud558\uace0 val\uc744 \uc500\uc73c\ub85c\uc368 \ucf54\ub4dc \ub85c\uc9c1\uc5d0 \uc788\uc5b4 \uc548\uc815\uac10\uc744 \uc8fc\uac8c \ub41c\ub2e4. \ub530\ub77c\uc11c \ubcc0\uc218\uac12\uc774 \ubcc0\ud558\ub294 \uc0c1\ud669\uc774 \uc5c6\ub2e4\uace0 \uc0dd\uac01\ub418\ub294 \uacbd\uc6b0, val\uc744 \uc0ac\uc6a9\ud558\ub3c4\ub85d \ud558\uc790!\\n\\n\ub450 \ubc88\uc9f8\ub85c, <span style={{color: \'#ff00ff\'}}>data class\ub97c entity \ud074\ub798\uc2a4\uc5d0\uc11c \uc0ac\uc6a9\ud558\ub294 \uac83\uc744 \uc9c0\uc591\ud558\uc790.</span>\\n\\n\ucf54\ud2c0\ub9b0\uc5d0\uc11c\ub294 data\ub9cc\uc744 \ub2e4\ub8e8\ub294 \ubaa9\uc801\uc758 \ud074\ub798\uc2a4\ub97c \ub530\ub85c \uc81c\uacf5\ud55c\ub2e4. data\ud0a4\uc6cc\ub4dc\ub97c \ucd94\uac00\ud558\uc5ec class\ub97c \uc0dd\uc131\ud574\uc8fc\uba74 \ud574\ub2f9 \ud074\ub798\uc2a4\ub294 lombok\uc758 @Data \uc5b4\ub178\ud14c\uc774\uc158\uacfc \uac19\uc774 getter, setter\uc744 \uc9c0\uc6d0\ud558\uace0 toString, toEqual, hashCode()\uc640 \uac19\uc740 Canonical Methods\ub3c4 \uc9c0\uc6d0\uc744 \ud55c\ub2e4!\\n\\n\ub098\ub294 \ubcc4 \uc0dd\uac01\uc5c6\uc774 \uc5d4\ud130\ud2f0\ub97c \uc77c\ubc18 \ud074\ub798\uc2a4\ub85c \ub9cc\ub4e4\uc5b4\uc92c\ub294\ub370, entity\ud074\ub798\uc2a4\ub610\ud55c \ub370\uc774\ud130\ub97c \ub2e4\ub8e8\ub294 \ubaa9\uc801\uc758 \ud074\ub798\uc2a4\uc774\ubbc0\ub85c, data class\ub97c \uc0ac\uc6a9\ud55c\ub294 \uac83\uc774 \uc801\ud569\ud560\ud150\ub370, entity\uc5d0\uc11c\ub294 \uc0ac\uc6a9\uc744 \uc9c0\uc591\ud558\ub77c\uace0 \ud574\uc11c \ubcc4 \uc0dd\uac01\uc5c6\uc774 \uc62c\ubc14\ub978 \ucf54\ub4dc\ub97c \uc9f0\ub2e4.\\n\\nentity\ud074\ub798\uc2a4\ub97c data \ud074\ub798\uc2a4\ub85c \uad6c\ud604\ud558\ub294 \uac83\uc744 \uc9c0\uc591\ud558\ub294 \uc774\uc720\ub294, \uc5d4\ud130\ud2f0\ub07c\ub9ac \uc591\ubc29\ud5a5 \uc5f0\uad00\uad00\uacc4\uac00 \uc124\uc815\ub418\uc5b4\uc788\uc744 \ub54c, toString, hashCode()\uc640 \uac19\uc740 \ud568\uc218\ub97c \uc0ac\uc6a9\ud558\uba74 \ubb34\ud55c \uc21c\ud658 \ucc38\uc870\uac00 \ubc1c\uc0dd\ud560 \uc218 \uc788\uae30 \ub54c\ubb38\uc774\ub77c\uace0 \ud55c\ub2e4.\\n\\n\ub098\uc911\uc5d0 \uc54c\uac8c\ub418\uc5c8\ub294\ub370, \ucf54\ud2c0\ub9b0\uc5d0\uc11c\ub294 \ub86c\ubcf5\uc774 \uc9c0\uc6d0\ud558\ub294 <span style={{color: \'#ff00ff\'}}>@Getter, @Setter, @Builder, @RequiredArgsConstructor\uacfc \uac19\uc740 \uae30\ub2a5\uc744 var, val, \uc8fc\uc0dd\uc131\uc790\ub85c \ud574\uacb0\uc774 \uac00\ub2a5\ud558\ub2e4.</span>\\n\\nbuilder\ub97c \uc0ac\uc6a9\ud560 \ud544\uc694\uc5c6\uc774 \uc544\ub798\uc640 \uac19\uc774 \uc0dd\uc131\uc790\ub85c \uac12\uc744 \ub123\uc5b4\uc904 \uc218 \uc788\uace0,\\n\\n![code2.png](image/code2.png)\\n\uc5c5\ub370\uc774\ud2b8\ub97c \ud574\uc57c\ud558\ub294 \uc0c1\ud669\uc5d0\uc11c setter\ub97c \uc0ac\uc6a9\ud560 \ud544\uc694\uc5c6\uc774 \uac04\ub2e8\ud558\uac8c \uc544\ub798\uc640 \uac19\uc774 \u2018.\u2019\ud0a4\uc6cc\ub4dc\ub85c \uc811\uadfc\ud558\uc5ec \ud2b9\uc815 \ud544\ub4dc\uc758 \uc218\uc815\uac12\uc744 \ub123\uc5b4\uc8fc\uba74\ub41c\ub2e4!\\n\\n![code3.png](image/code3.png)\\n\uc544\uc9c1 \ub354 \uc368\ubd10\uc57c\uaca0\uc9c0\ub9cc, \uc5b8\uc5b4\ub97c \ubc14\uafb8\uc5c8\uc744 \ubfd0\uc778\ub370, \ucf54\ub4dc\uac00 \ub9ce\uc774 \ub2e8\uc21c\ud654\ub418\uace0 \uc9c1\uad00\uc801\uc774\ub77c\uace0 \ub290\uaf08\uace0, \uc678\ubd80 \ub77c\uc774\ube0c\ub7ec\ub9ac\ub85c \uc0ac\uc6a9\ud588\ub358 \uae30\ub2a5\ub4e4\uc744 \uc5b8\uc5b4 \uc790\uccb4\uc758 \uae30\ub2a5\ub9cc\uc73c\ub85c\ub3c4 \ucda9\ubd84\ud558\uac8c \uc0ac\uc6a9\uc774 \uac00\ub2a5\ud558\ub2e4\ub294 \uac83\uc744 \uc54c\uac8c\ub418\uc5c8\ub2e4!"},{"id":"thingking","metadata":{"permalink":"/Blog/blog/thingking","editUrl":"https://github.com/facebook/docusaurus/edit/main/website/blog/blog/2022-01-03-thinking1.mdx","source":"@site/blog/2022-01-03-thinking1.mdx","title":"1\uc6d4 3\uc77c\uc758 \uc0dd\uac01","description":"\uc88b\uc740 \ubd84\ub4e4\uacfc \uc9c4\ud589\ud558\uace0 \uc788\ub294 \ub514\uc790\uc778 \ud328\ud134 \uc2a4\ud130\ub514\uac00 \uc7a5\uc7a5 3\ub2ec\uc744 \uc774\ub77c\ub294 \uc2dc\uac04\uc774 \ud758\ub7ec \ub9c8\uc9c0\ub9c9 \uc8fc\uac00 \ub418\uc5c8\ub2e4.","date":"2022-01-03T00:00:00.000Z","formattedDate":"January 3, 2022","tags":[{"label":"thingking","permalink":"/Blog/blog/tags/thingking"}],"readingTime":2.835,"truncated":false,"authors":[{"name":"Lim SeongKyu","title":"BE","url":"https://github.com/seongkyu-lim","imageURL":"https://github.com/seongkyu-lim.png","key":"seongkyu"}],"prevItem":{"title":"1\uc6d4 15\uc77c\uc758 \uae68\ub2ec\uc74c","permalink":"/Blog/blog/knowledge1"}},"content":"\uc88b\uc740 \ubd84\ub4e4\uacfc \uc9c4\ud589\ud558\uace0 \uc788\ub294 \ub514\uc790\uc778 \ud328\ud134 \uc2a4\ud130\ub514\uac00 \uc7a5\uc7a5 3\ub2ec\uc744 \uc774\ub77c\ub294 \uc2dc\uac04\uc774 \ud758\ub7ec \ub9c8\uc9c0\ub9c9 \uc8fc\uac00 \ub418\uc5c8\ub2e4.\\n\\n\ub9c8\uc9c0\ub9c9\uc73c\ub85c \uc815\ub9ac\ub97c \ub2f4\ub2f9\ud558\uc600\ub294\ub370, \uc815\ub9ac\ub97c \uc704\ud574 \uc2a4\ud130\ub514\ud55c \ub0b4\uc6a9\uc744 \ub2e4\uc2dc \uc77d\uc5b4\ubcf4\ub2c8 \ub0b4\uac00 \uc774\uac78 \uacf5\ubd80\ud588\uc5c8\ub098 \uc2f6\uc740 \ub180\ub77c\uc6b4 \uc0c1\ud669\uc774..\\n\\n\uc5b8\uc820\uac00 \uc368\uba39\uc744 \ub54c\uac00 \uc788\uaca0\uc9c0 \uc2f6\uc5b4 \uadf8\ub798\ub3c4 \uac1c\ub150\ub4e4\uc744 \ub2e4\uc2dc \ud55c\ubc88 \uc815\ub9ac\ud574\ubcf4\uc790.\\n\\n\uc0ac\uc2e4 \ub514\uc790\uc778 \ud328\ud134\uc774\ub77c\ub294 \uac1c\ub150\uc5d0 \uc5b4\ub5a4 \uc2dd\uc73c\ub85c \uc811\uadfc\uc744 \ud574\uc57c\ud560\uc9c0 \uc2a4\ud130\ub514 \ub9c8\uc9c0\ub9c9 \uc8fc\uae4c\uc9c0\ub3c4 \uac10\uc774 \uc798 \uc624\uc9c0 \uc54a\ub294\ub2e4.\\n\\n\uadf8\ub798\uc11c \ud604\uc9c1\uc790\uc758 \uc2dc\uc120\uc744 \ube4c\ub824\ubcf4\uace0\uc790 \uc5ec\ub7ec \uac1c\ubc1c\uc790\ubd84\ub4e4\uc758 \ube14\ub85c\uadf8\uc5d0 \ub514\uc790\uc778 \ud328\ud134\uc5d0 \ub300\ud55c \ub0b4\uc6a9\uc774 \uc788\ub294\uc9c0 \ucc3e\uc544\ubcf4\ub2e4\uac00 \ud604\uc7ac \uc778\ud504\ub7f0 CTO\ub97c \ub9de\uace0 \uac8c\uc2e0 \uc774\ub3d9\uc6b1\ub2d8\uc758 \ube14\ub85c\uadf8\uc758 \ud3ec\uc2a4\ud2b8\ub85c \ub4e4\uc5b4\uac00\uac8c \ub418\uc5c8\ub2e4.\\n\\n\uc790\ubc14\uc9c0\uae30(\ubc15\uc7ac\uc131)\ub2d8\uc758 \uc138\ubbf8\ub098 \ub0b4\uc6a9 \uc815\ub9ac \uae00\uc774\uc5c8\ub2e4.\\n\\n### \uc0b6\uc744 \ud6cc\ub96d\ud558\uac8c \uac00\uafb8\uc5b4\uc8fc\ub294 \uac83\uc740 \ud589\ubcf5\uac10\uc774 \uc544\ub2c8\ub77c \uae4a\uc774 \ube60\uc838\ub4dc\ub294 \ubab0\uc785\uc774\ub2e4.\\n\\n\uc88b\uc740 \uae00\uadc0\uc640 \ud568\uaed8, \uc2a4\ud130\ub514\uc758 \ub9c9\ubc14\uc9c0\uc5d0 \uc640\uc11c\ub3c4 \ub514\uc790\uc778 \ud328\ud134\uc5d0 \ub300\ud55c \uac10\uc774 \uc798 \uc624\uc9c0 \uc54a\ub294 \ub0b4\uac00 \uc815\uc0c1\uc774\ub77c\ub294 \uac83\uc744 \ub9d0\ud574\uc8fc\ub294 \ubb38\uc7a5\uc774 \uc788\ub2e4.\\n\\n- \ub514\uc790\uc778 \ud328\ud134\uc744 \uacf5\ubd80\ud574\ub3c4 \uc5b4\ub514\uc5d0 \uc4f8\uc9c0 \ubaa8\ub974\ub294 \uacbd\uc6b0\uac00 \ub9ce\ub2e4.\\n- \ub9ac\ud329\ud1a0\ub9c1\uc744 \ub04a\uc784\uc5c6\uc774 \ud558\ub2e4\uac00 \ub514\uc790\uc778\ud328\ud134\uc744 \ubcf4\uba74 \ub354 \ud070 \uae68\ub2ec\uc74c\uc744 \uc5bb\uc9c0\ub9cc, \ubc18\ub300\ub85c\ud558\uac8c \ub418\uba74 \uc2a4\ud2b8\ub808\uc2a4\ub9cc \ub298\uc218\ub3c4 \uc788\ub2e4.\\n\\n\ub9de\ub2e4. \uc0ac\uc2e4 \uc9c0\uae08\uc758 \ub098\ud55c\ud14c \ub514\uc790\uc778 \ud328\ud134\uc740 \ubc18\ub4dc\uc2dc \ud544\uc694\ud55c \uac1c\ub150\uc740 \uc544\ub2d0 \uc218 \uc788\ub2e4.\\n\\n### \uadf8\ub807\ub2e4\uba74 \ub514\uc790\uc778 \ud328\ud134\uc744 \uacf5\ubd80\ud558\uba74\uc11c \uc5bb\uc744 \uc218 \uc788\uc5c8\ub358 \uacbd\ud5d8\uc740 \ubb34\uc5c7\uc778\uac00 ?\\n\\n- \uc790\ubc14 \uc5b8\uc5b4\ub97c \uacf5\ubd80\ud560 \ub54c, \uc54c\uace0\ub9ac\uc998 \ubb38\uc81c\ub97c \ud480\uac70\ub098 \uac15\uc758\ub97c \ub4e4\uc73c\uba70 \ubb38\ubc95\uc801\uc778 \uac83\uc744 \uacf5\ubd80\ub97c \ud588\ub2e4\uba74 \ub514\uc790\uc778 \ud328\ud134\uc744 \uacf5\ubd80\ud558\uba70 \uc608\uc2dc\ub4e4\uc744 \ubcf4\uba74\uc11c \uc21c\uc218 \uc790\ubc14\uc5b8\uc5b4\ub85c \uc9dc\ub294 \ucf54\ub4dc\ub4e4\uc5d0 \ub300\ud55c \uc2dc\uc57c\uac00 \ud655\uc7a5 \ub428.\\n- \ucf54\ub4dc\ub97c \uc124\uba85\ud558\ub294 \ub2a5\ub825\uc758 \ubd80\uc871\ud568, \uac1c\uc120\ud558\uace0\uc790\ud558\ub294 \uc758\uc9c0\ub97c \uc5bb\uc74c."}]}')}}]);